class FilterComponent extends Component {
    render() {

      return (
        <div className="row">
        <div className="col-12 col-lg-12 col-md-12 col-sm-12">
          <div className="card">
            <div className="row">
            <div className="col-6 col-lg-6 col-md-6 col-sm-6">
            <span>Filter</span> 
            </div>
            <div className="col-6 col-lg-6 col-md-6 col-sm-6">
            <span>
          <button>Reset</button>
        </span>
            </div>
            </div>
            <div>PropertySize</div>
            <div>Rent</div>
            <div>PhotosAvailable</div>
          </div>
        </div>
      </div>
      );
    }
  }

  export default FilterComponent;
